import React, { useState, useEffect } from 'react';
import Planet from '../Planet/planet.js';
import './RouteFinder.css';

function RouteFinder() {
  const [fromPlanet, setFromPlanet] = useState('');
  const [toPlanet, setToPlanet] = useState('');
  const [mode, setMode] = useState('selecting');
  const [routes, setRouteInfo] = useState([]);
  const [displayLimit, setDisplayLimit] = useState(5);

  useEffect(() => {
    if (fromPlanet && toPlanet) {
      setMode('selected');
    } else if (fromPlanet) {
      setMode('deselected');
    } else {
      setMode('selecting');
    }
  }, [fromPlanet, toPlanet]); // Run the effect whenever the fromPlanet or the toPlanet changes

  // A callback function that updates the fromPlanet and the toPlanet values based on the mode and the planet name
  const handlePlanetClick = (planet) => {
    if (mode === 'selecting') {
      setFromPlanet(planet);
    } else if (mode === 'deselected') {
      setToPlanet(planet);
    } else if (mode === 'selected') {
      return;
    }
  };


  const validateForm = (event) => {
    event.preventDefault();

    
      if (fromPlanet === '' || toPlanet === '' && event.target.value === 'submit') {
        alert('Please select a planet for both Origin and Destination.');
        return;
      }

      if (fromPlanet === toPlanet && fromPlanet !== '' && toPlanet !== '') {
        alert('From and To locations cannot be the same planet.');
        setToPlanet('');
        return;
      }

      searchRoutes();
    
  };

  const handleClearClick = (id) => {
      setFromPlanet('');
      setToPlanet('');
  };


  const searchRoutes = () => {
    const apiURL = process.env.REACT_APP_BACKEND_API_URL;
    const url = apiURL + `/api/FlightFinder?startLoc=${fromPlanet}&endLoc=${toPlanet}`;

    fetch(url)
      .then((response) => response.json())
      .then((data) => {
        setRouteInfo(data);
        setDisplayLimit(5);
        console.log(data);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  };

  // A helper function that returns the appropriate class name for a planet
  const getPlanetClass = (planet) => {
    if (mode === 'selecting') {
      return '';
    } else if (mode === 'deselected') {
      if (planet === fromPlanet) {
        return 'planet-from';
      } else {
        return '';
      }
    } else if (mode === 'selected') {
      if (planet === fromPlanet) {
        return 'planet-from planet-selected';
      } else if (planet === toPlanet) {
        return 'planet-to planet-selected';
      } else {
        return 'planet-selected';
      }
    }
  };

  return (
    <div className="route-finder-container">
      <h2>Search Routes</h2>
      <form onSubmit={validateForm}>
        <div className="planet-container">
          <Planet
            planet="Mercury"
            onClick={handlePlanetClick}
            className={getPlanetClass('Mercury')}
          />
          <Planet
            planet="Venus"
            onClick={handlePlanetClick}
            className={getPlanetClass('Venus')}
          />
          <Planet
            planet="Earth"
            onClick={handlePlanetClick}
            className={getPlanetClass('Earth')}
          />
          <Planet
            planet="Mars"
            onClick={handlePlanetClick}
            className={getPlanetClass('Mars')}
          />
          <Planet
            planet="Jupiter"
            onClick={handlePlanetClick}
            className={getPlanetClass('Jupiter')}
          />
          <Planet
            planet="Saturn"
            onClick={handlePlanetClick}
            className={getPlanetClass('Saturn')}
          />
          <Planet
            planet="Uranus"
            onClick={handlePlanetClick}
            className={getPlanetClass('Uranus')}
          />
          <Planet
            planet="Neptune"
            onClick={handlePlanetClick}
            className={getPlanetClass('Neptune')}
          />
        </div>
        <div className="selected-planets">
          <p>Origin: {fromPlanet || 'None'}</p>
          <p>Destination: {toPlanet || 'None'}</p>
        </div>
        <div className="buttons">
        <button className="search-button" type="submit">Search</button>
        <button
          className="search-button"
          onClick={() => handleClearClick('to')}> Clear
        </button>
        </div>

      </form>
    </div>
  );
}

export default RouteFinder;
